import * as React from 'react';

function Play(props: any) {
  return (
    <svg height="1em" preserveAspectRatio="xMidYMid" viewBox="0 0 128 128" width="1em" {...props}>
      <path d="M119.351 64L8.65 0v128z" fill="currentColor" />
    </svg>
  );
}

export default Play;
